import React, { Component } from 'react';

class FilterVers extends Component{
    state ={
        items: this.props.items || []
    }

    render() {
        return <div>
            {
                this.state.items.map(item => <div key={ item.id }>
                    {item.value}
                </div>)
            }
            </div>
        
    }

}

export default FilterVers;
